import React from 'react';
import { Link } from 'react-router-dom';

const Workout = () => {
  return (
    <div id="workout-screen">
      <Link to="/" class="upper-left">
        <button type="button" class="arrow-button">&larr;</button>
      </Link>
      <button type="button" class="upper-right">TIMES</button>
    </div>
  );
}

export default Workout;
